        model.setStyle({chain:'B'}, {cartoon: { color: CHAIN_B, opacity: 0.98 }});
      }
      // Ligand ball-and-stick (CPK)
      model.setStyle({resn:'LIG'}, {stick: { radius: 0.25 }, sphere: { radius: 0.55 }});
    }

    function showSidechains(model){
      // Explicit residues: Tyr44 (yellow), Ser57 (red), Phe62 (lime)
      // Use addStyle to preserve the ribbon while adding stick representation
      model.addStyle({resi: 44}, {stick: { radius: 0.28, color: YELLOW }});  // Tyr44 sidechain + CA

      model.addStyle({resi: 57}, {stick: { radius: 0.28, color: RED }});     // Ser57 sidechain + CA

      model.addStyle({resi: 62}, {stick: { radius: 0.28, color: LIME }});    // Phe62 sidechain + CA

      // model.setStyle({chain:'A', resi: [58,59,60,61]}, {stick: { radius: 0.24, color: CHAIN_A }});
      // model.setStyle({chain:'B', resi: [58,59,60,61]}, {stick: { radius: 0.24, color: CHAIN_B }});
      // Ligand-coordinating residues within 4 Ã… (entire residue)
      // model.setStyle({byres:true, within: {distance: 4.0, sel: {resn:'LIG'}}},
//                      {stick: { radius: 0.20, opacity: 1.0 }});
    }

    function labelAt(text, p){
      if (!el('showLabels').checked) return;
      viewer.addLabel(text, { position: p, backgroundOpacity: 0.6, fontSize: 14 });
    }

    function chainFromLabel(lbl){
      return (lbl && lbl.endsWith('_B')) ? 'B' : 'A';
    }

    function addCenters(){
      const pts = RAW_CENTERS[state] || [];
      if (!pts.length) return 0;
      let count=0;
      for (const p of pts) {
        const ch = chainFromLabel(p.label);
        const color = (ch === 'B') ? CHAIN_B : CHAIN_A;
        //         const shape = viewer.addShape({color: color, opacity: 1.0});
        //         shape.addSphere({ center: {x:p.x, y:p.y, z:p.z}, radius: 2.2, color: color, opacity: 1.0 });
        labelAt(p.label, {x:p.x, y:p.y, z:p.z});
        count++;
      }
      // dashed connectors + distances
      function get(name) { return pts.find(q => q.label === name); }
      const lA=get('Ligand Binding Domain [Protomer 1]'), lB=get('Ligand Binding Domain [Protomer 2]');
      const dA=get('DNA Binding Domain [Protomer 1]'), dB=get('DNA Binding Domain [Protomer 2]');
      if (lA && lB) addDashedDistance(lA, lB);
      if (dA && dB) addDashedDistance(dA, dB);
      return count;
    }

    function addDashedDistance(a, b){
      const start = {x:a.x, y:a.y, z:a.z};
      const end   = {x:b.x, y:b.y, z:b.z};
      const dx = b.x - a.x, dy = b.y - a.y, dz = b.z - a.z;
      const dist = Math.sqrt(dx*dx + dy*dy + dz*dz);
      viewer.addLine({
        start: start, end: end, dashed: true, dashLength: 2.0, gapLength: 1.2, linewidth: 3, color: 10265519
      });
      const mid = {x: a.x + dx*0.5, y: a.y + dy*0.5, z: a.z + dz*0.5};
      labelAt(dist.toFixed(1) + " Ã…", mid);
    }

    function draw(){
      stopSpin();
      viewer.clear();
      let centersCount = 0;
      if (el('showPDB').checked) {
        const pdb = PDBS[state] || "";
        if (pdb.trim().length) {
          const m = viewer.addModel(pdb, "pdb");
          showProtein(m);
          if (el('showSidechains').checked) showSidechains(m);
        } else {
          viewer.addLabel("No PDB embedded for " + state, { fontSize: 16, backgroundOpacity: 0.6 });
        }
      }
      if (el('showCenters').checked) {
        centersCount = addCenters();
      }
      viewer.zoomTo();
      viewer.render();
      status.textContent = "State: " + state +
        " Â· Mode: " + (el('fastMode').checked ? "Fast (trace)" : "Cartoon") +
        " Â· Sidechains: " + (el('showSidechains').checked ? "ON" : "OFF") +
        " Â· Centers: " + centersCount + (centersCount ? " shown" : " (none found)");
      if (el('spin').checked) startSpin();
    }

    draw();
    viewer.rotate(180, {x:1, y:0, z:0});
    viewer.render();
  }
})();
</script>
</body>
</html>
